//SPDX-License-Identifier: MIT

pragma solidity 0.7.5;
pragma abicoder v2;

import "./ERC666.sol";
import "./BrutesFactory.sol"; 
import "./EquipmentFactory.sol";
import "./utils/SafeMath.sol";
import "./utils/Ownable.sol";


contract BruteCore is Ownable, ERC666, BrutesFactory, EquipmentFactory {


        function initGame()external {
                mintSFTbaseBrute(0, 0, 0, 10000);
                mintSFTbaseBrute(1, 0, 1, 10000);
                mintSFTbaseBrute(2, 1, 2, 10000);
                mintSFTbaseBrute(3, 1, 3, 10000);
                uint[] memory arrayz;
                createBatchSameGearOwners("Epee", 1, arrayz, 1, "test.png", 0, 10, 10, 10, 0, 10000);
                createBatchSameGearOwners("Bouclier", 2, arrayz, 1, "test.png", 10, 0, 0, 0, 10, 10000);
                createBatchSameGearOwners("Hache", 1, arrayz, 1, "test.png", 0, 20, 20, 2, 0, 10000);
        }
}
